(254, 'wpforms_notifications', 'a:4:{s:6:\"update\";i:1630685849;s:4:\"feed\";a:2:{i:0;a:6:{s:5:\"title\";s:101:\"New in WPForms! Entry Preview Field for Multi-Step Forms + Improved Entry Search & Keyboard Shortcuts\";s:7:\"content\";s:405:\"Our most requested feature, Entry Preview field, is finally here. This is super helpful for multi-step forms and mission-critical forms where you want to avoid typos and inaccurate details. It lets users preview all form information before they click the submit button. Plus, we also improved our Entry Management by adding better search filters, and we added keyboard shortcuts to speed up your workflow.\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:88;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:213:\"https://wpforms.com/announcing-the-new-entry-preview-field-added-entry-editing-features-wpforms-1-6-9/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=WPForms 169 Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:157:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=WPForms 169 Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2021-08-26 00:00:00\";}i:1;a:6:{s:5:\"title\";s:86:\"Updated in WPForms 1.6.8! A Fresh Form Builder Experience + Tons of New Form Templates\";s:7:\"content\";s:402:\"WPForms 1.6.8 includes a big revamp to the form builder you know and love, with visual updates + reorganization and optimization. Plus, in addition to the new templates available for all users, those with WPForms Pro can now instantly access hundreds more newly built templates, so youâll never have to build a form from scratch again. Itâs easier than ever before to build and maintain your forms.\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:82;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:194:\"https://wpforms.com/introducing-wpforms-1-6-8-refreshed-form-builder-new-templates/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=WPForms 168 Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:157:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=WPForms 168 Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2021-07-28 00:00:00\";}}s:6:\"events\";a:0:{}s:9:\"dismissed\";a:0:{}}', 'yes'),
